import React , {Component} from 'react';
import Child from './test';

class App extends Component{
  state = {
    name : "Ahmed",
    age : 25
  }

  change = () =>{
    this.setState ({
      name : "ay 7aga b2aaaaaa"
    })
  }



render(){
    return (
      <div className="app">
        <Child/>

        <button onClick={this.change}>click to change</button>
        <p>{ this.state.name }</p>
        <p>{this.state.age}</p>
      </div>
    );
  }
}
export default App;
